        Plotly.relayout(myPlot, {shapes: shapes});
    });
    myPlot.on('plotly_unhover', function(data){
        var shapes = myPlot.layout.shapes;
        for(var i=0; i<shapes.length; i++){
            shapes[i].opacity = 0;
        }
        Plotly.relayout(myPlot, {shapes: shapes});
    });
    </script>
